Step-by-step reasoning:
1. Psychological mechanisms: When acting as a proposer, participants likely decide on how much to offer their opponent based on a fairness heuristic. They compare their own token count (token_self) with that of their opponent (token_opp) and adjust their share according to perceived fairness. In addition, the experimental manipulation represented by trial_type (equal contributions, opponent more, participant more) may shift this fairness reference.

2. Interaction: The decision process can be captured by a latent utility that depends on a normalized fairness differential (the difference between opponent and self tokens relative to their sum) and adjustments for trial_type effects. This utility is then transformed via a logistic function to yield a probability. Because the target variable is the proposed percentage offer (proposed_perc) by the proposer, we can map the probability to a percentage by scaling the logistic output to the [0,100] range.

3. Mathematical form: We define a latent utility u as a linear combination of:
   • A baseline bias (a)
   • A sensitivity parameter (b) weighing the normalized fairness differential ((token_opp – token_self)/(token_opp + token_self))
   • Additive shifts (c and d) for trial types 2 and 3 respectively.

   The logistic function transforms u to yield a probability p = 1/(1+exp(–u)); this probability is then scaled by 100 to produce the predicted proposed percentage.

4. Parameters: The learnable parameters are a, b, c, and d. We provide generous finite bounds (each in [–10, 10]) to avoid non-identifiability, reducing high covariance by using a relatively simple, low-dimensional parameterization.

5. Mapping to observables: Data-derived variables include token_self, token_opp, and trial_type. The indicator variables for trial_type (I(trial_type==2) and I(trial_type==3)) capture contextual shifts. The final output is proposed_perc which the model predicts through the logistic mapping.

Below is the formal specification:

<MODEL>
proposed_perc = 100/(1+exp(-(a + b*((token_opp - token_self)/(token_opp + token_self)) + c*I(trial_type == 2) + d*I(trial_type == 3))))
</MODEL>

